NHS Hull Clinical Commissioning Group (CCG) has commenced a review of its commissioning arrangements for the provision of Non-Emergency Medical Transport Services and seeking expressions of interest from providers. 

The service will provide safe, high quality, dignified and cost effective patient centred non-emergency medical transport service solution that will manage and deliver all non-emergency medical patient journeys (requiring both medically equipped and non-medical vehicles) for eligible patients. The service will support and be responsive to hospital discharges requirements.

The service will be expected to operate robust systems to ensure the service is available to eligible patients who are registered with a Hull GP or living in Hull but not registered with a GP.

The service will be required to:
•	Ensure patients with a medical need receive a professional, responsive and high quality transport service that meets the needs of both the patient and effective service delivery;
•	Ensure each patient reaches their destination in comfort, without detriment to their medical condition, on time for their appointment and within a reasonable journey time;
•	Ensure patients equity of access to healthcare;
•	Deliver measureable improvements in patient experience;
•	Deliver value for money in the managing and delivery of non-emergency medical patient journeys;
•	Provide fit for purpose vehicle solutions and levels of care to meet the varying clinical needs of patients;
•	Satisfy the CCG responsibility for the provision of suitable transport for eligible patients.

It is NHS Hull Clinical Commissioning Group’s intention that formal procurement activities will commence no later than July 2016. Instructions for registering interest in this contract. Register on the www.nhssourcing.co.uk website, search for: pqq_29260 - EXPRESSIONS OF INTEREST - Non-emergency Medical Transport Services - NHS Hull CCG, and register your interest. The deadline for Expressions of Interest is 14 April 2016
